import React, { Component , useState , useEffect} from 'react';
import testData from "../Data/data.json"
import '../css/test.css'



var YourAnswers = ({answer}) => {



    return(
        <div>


            {
                testData.data.map((question , i) => (





            <section className="modal-card-body content">



                        <ul className="co-md-4 result_ul">
                    <li  className="co-md-4">

                        <p><strong>{question.question}</strong></p>

                        <p className='has-background-success has-text-white p-2'>Your answer: { answer[0].answer }</p>

                    </li>


                </ul>
                <hr/>




            </section>


            ))}



        </div>
    );

}

export default YourAnswers;
